import React from 'react'

export default function BlogTitleSide({ posts }) {

  const displayTitles = () => {
    return posts.map(post => {
      return <h1>{post.title}</h1>
    })
  }

  return (
    <nav className="bg-gray-300 w-1/4 ">
      {displayTitles()}
    </nav>
  )
}
